<html xmlns="http://www.w3.org/1999/xhtml">
<meta charset="UTF-8">
<head>
    <style>
        body{
            background-color:#ffffff;
            margin: 0px;
            height: 100%;
            overflow: hidden;
        }
        #lottie{
            background-color:#ffffff;
            width:100%;
            height:100%;
            display:block;
            overflow: hidden;
            transform: translate3d(0,0,0);
            text-align: center;
            opacity: 1;
        }

        #scroll-indicator {
            position: fixed;
            right: 20px;
            top: 10vh; /* Initial position, will be updated by JS */
            width: 8px;
            height: 8px;
            background-color: rgba(0, 0, 0, 0.5);
            border-radius: 50%;
            z-index: 1000;
            pointer-events: none; /* So it doesn't interfere with other interactions */
        }
    </style>
</head>

    var params = {
        container: document.getElementById('lottie'),
        renderer: 'svg',
        loop: false, // Changed from true
        autoplay: false, // Changed from true
        animationData: animationData,
    };

    var anim;

    window.addEventListener('DOMContentLoaded', function() {
        anim = lottie.loadAnimation(params);

        // Scroll-based animation control
        anim.addEventListener('DOMLoaded', function () {
            let currentFrame = 0;
            let targetFrame = 0;
        const scrollSensitivityFactor = 0.50; // Adjust for sensitivity: smaller means less sensitive
        const animationSmoothness = 0.1; // Adjust for smoothness: 0.1 is quite smooth, closer to 1 is faster/jumpier

        let isAnimating = false;
        let rafId = null;

        const scrollIndicator = document.getElementById('scroll-indicator');
        const indicatorMinTopVh = 10; // Start position in vh
        const indicatorMaxTopVh = 90; // End position in vh
        const indicatorTravelRangeVh = indicatorMaxTopVh - indicatorMinTopVh;

        anim.goToAndStop(currentFrame, true);
        // Initial indicator position
        if (scrollIndicator) {
            scrollIndicator.style.top = indicatorMinTopVh + 'vh';
        }


        function updateScrollIndicator() {
            if (scrollIndicator && anim.totalFrames > 1) {
                const progress = currentFrame / (anim.totalFrames - 1);
                const indicatorTop = indicatorMinTopVh + (progress * indicatorTravelRangeVh);
                scrollIndicator.style.top = indicatorTop + 'vh';
            }
        }

        function smoothAnimateToTarget() {
            if (Math.abs(targetFrame - currentFrame) < 0.1) {
                currentFrame = targetFrame; // Snap to target
                anim.goToAndStop(Math.round(currentFrame), true);
                updateScrollIndicator();
                isAnimating = false;
                rafId = null;
                return;
            }

            currentFrame += (targetFrame - currentFrame) * animationSmoothness;
            anim.goToAndStop(Math.round(currentFrame), true);
            updateScrollIndicator();

            rafId = requestAnimationFrame(smoothAnimateToTarget);
        }

        function handleScroll(delta) {
            targetFrame += delta * scrollSensitivityFactor;

            // Clamp targetFrame to animation bounds
            if (targetFrame < 0) {
                targetFrame = 0;
            } else if (targetFrame >= anim.totalFrames) {
                targetFrame = anim.totalFrames - 1;
            }

            if (!isAnimating) {
                isAnimating = true;
                rafId = requestAnimationFrame(smoothAnimateToTarget);
            }
        }

        window.addEventListener('wheel', function (event) {
            event.preventDefault();
            handleScroll(event.deltaY);
        }, { passive: false });

        // Touch event handling
        let lastTouchY = 0;
        let isTouching = false;

        window.addEventListener('touchstart', function(event) {
            if (event.touches.length === 1) {
                lastTouchY = event.touches[0].clientY;
                isTouching = true;
                // Optional: if you want to prevent default touch actions like page scroll
                // event.preventDefault();
            }
        }, { passive: true }); // Use passive true if not preventing default

        window.addEventListener('touchmove', function(event) {
            if (!isTouching || event.touches.length !== 1) {
                return;
            }
            // Optional: if you want to prevent default touch actions like page scroll
            // event.preventDefault();

            const touchY = event.touches[0].clientY;
            const deltaY = lastTouchY - touchY; // Inverted compared to wheel delta
            lastTouchY = touchY;

            handleScroll(deltaY);
        }, { passive: true }); // Use passive true if not preventing default

        window.addEventListener('touchend', function(event) {
            isTouching = false;
        });

        window.addEventListener('touchcancel', function(event) {
            isTouching = false;
        });

        // Keyboard event handling for Up and Down arrow keys
        const keyboardScrollStep = 30; // Adjust for how much one key press scrolls, similar to wheel delta

        window.addEventListener('keydown', function(event) {
            let delta = 0;
            if (event.key === 'ArrowDown') {
                delta = keyboardScrollStep;
                event.preventDefault(); // Prevent default page scroll
            } else if (event.key === 'ArrowUp') {
                delta = -keyboardScrollStep;
                event.preventDefault(); // Prevent default page scroll
            }

            if (delta !== 0) {
                handleScroll(delta);
            }
        });

    });
}); // End of DOMContentLoaded listener
